import React from 'react';

import './add-item.css';

const AddItem = () => {
    return (
        <div className="d-flex mt-4">
            <input type="text"
                   className="form-control search-input"
                   placeholder="type to search" />
            <button className="btn btn-primary">Add New Item</button>
       </div>
    );
};

export default AddItem;
